import React from "react";

export default function Contact(){
    return(
        <>
            <h1>Contact me</h1>

            <div id="form_holder">
                <h1>Send a message!</h1>
                <div id="form">
                    <form target="_blank" action="https://formsubmit.co/48948502f7102889a4911f12ab0a0a90" method="POST">
                        <input type="text"id="firstName"name="First Name:" placeholder="First Name" required />

                        <input type="text"id="lastName"name="lastName" placeholder="Last Name" required />

                        <input type="email"id="email"name="email" placeholder="Email" required />

                        <textarea id="message" name="message" rows="10" cols="35" placeholder="Message" required></textarea>
                        
                        
                        <button type="submit" id="submit">Submit</button>
                    </form>
                </div>
            </div>
        </>
    );
}
